import Link from "next/link";
const TopNavbar = () => (
  <nav className="navbar">
    <head>
    <meta name="viewport" content="width=device-width, initial-scale=1.0"></meta>
    </head>
    <style jsx>
      {`
      .float{
        position:fixed;
        width:60px;
        height:60px;
        bottom:40px;
        right:40px;
        background-color:#0C9;
        color:#FFF;
        border-radius:50px;
        text-align:center;
        box-shadow: 2px 2px 3px #999;
      }
      .my-float{
        margin-top:22px;
      }
`}
    </style>
  </nav>
);

export default TopNavbar;
